{'published': '07 Jul 2008, 17:51', 'summary': 'Blood on the Tracks is singer-songwriter Bob Dylan's 15th studio album, released in 1975 by Columbia Records, which marked Dylan's return to Columbia after a two-album stint with Asylum Records. The album, which followed several years of lukewarm reception for Dylan's work, was greeted respectably by fans and critics. In the years following its release, it has come to be regarded as one of his very best albums — making it quite common for subsequent records to be labeled his "best since Blood on the Tracks." It is also commonly seen as a standard for confessional singer-songwriter albums; though Dylan <a href="https://www.last.fm/music/Bob+Dylan/Blood+on+the+Tracks">Read more on Last.fm</a>.', 'content': 'Blood on the Tracks is singer-songwriter Bob Dylan's 15th studio album, released in 1975 by Columbia Records, which marked Dylan's return to Columbia after a two-album stint with Asylum Records.

The album, which followed several years of lukewarm reception for Dylan's work, was greeted respectably by fans and critics. In the years following its release, it has come to be regarded as one of his very best albums — making it quite common for subsequent records to be labeled his "best since Blood on the Tracks." It is also commonly seen as a standard for confessional singer-songwriter albums; though Dylan has denied that the songs are autobiographical, his son Jakob Dylan has stated: "The songs are my parents talking." Most of the lyrics on the album revolve around heartache, anger, and loneliness. In 2003, the album was ranked number 16 on Rolling Stone magazine's list of the 500 greatest albums of all time.

The album reached #1 on the Billboard U.S. pop charts and #4 in the UK. The single "Tangled Up in Blue" peaked at #31 on the Pop singles chart. The album remains one of Dylan's all-time best-selling studio releases, with a double-platinum US certification to date. <a href="https://www.last.fm/music/Bob+Dylan/Blood+on+the+Tracks">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 20:34', 'summary': 'It Takes a Nation of Millions to Hold Us Back is the second studio album by American hip hop group Public Enemy, released in April 1988 by Def Jam Recordings. Public Enemy set out to make the hip hop equivalent to Marvin Gaye's What's Going On, an album noted for its strong social commentary. Recording sessions took place during 1987 at Chung King Studios, Greene St. Recording, and Sabella Studios in New York City. Noting the enthusiastic response toward their live shows, Public Enemy intended with Nation of Millions to make the music of a faster tempo than the previous <a href="https://www.last.fm/music/Public+Enemy/It+Takes+a+Nation+of+Millions+to+Hold+Us+Back">Read more on Last.fm</a>.', 'content': 'It Takes a Nation of Millions to Hold Us Back is the second studio album by American hip hop group Public Enemy, released in April 1988 by Def Jam Recordings. Public Enemy set out to make the hip hop equivalent to Marvin Gaye's What's Going On, an album noted for its strong social commentary. Recording sessions took place during 1987 at Chung King Studios, Greene St. Recording, and Sabella Studios in New York City. Noting the enthusiastic response toward their live shows, Public Enemy intended with Nation of Millions to make the music of a faster tempo than the previous album for performance purposes.

The album charted for 49 weeks on the US Billboard 200, peaking at number 42. By August 1989, it was certified platinum by the Recording Industry Association of America, for shipments of one million copies in the United States. The album was very well received by music critics, who hailed it for its production techniques and the socially and politically charged lyricism of lead MC Chuck D. It also appeared on many publications' year-end top album lists for 1988, and was the runaway choice as the best album of 1988 in The Village Voice's Pazz & Jop critics' poll, a poll of the leading music critics in the US.

Since its initial reception, It Takes a Nation of Millions to Hold Us Back has been regarded by music writers and publications as one of the greatest and most influential albums of all time. In 2003, the album was ranked number 48 on Rolling Stone magazine's list of the 500 greatest albums of all time, the highest ranking of all the hip hop albums on the list. <a href="https://www.last.fm/music/Public+Enemy/It+Takes+a+Nation+of+Millions+to+Hold+Us+Back">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '02 Feb 2021, 17:56', 'summary': 'My Beautiful Dark Twisted Fantasy is the 2010, fifth studio album by American hip hop rapper and producer Kanye West. Following a period of public and legal controversy, West retreated to a "self-imposed exile" in Hawaii in 2009. There, he worked on the album in a communal recording environment that involved numerous contributing musicians and producers. A widespread critical success, it was named the best record of 2010 by many publications and has since appeared on several lists ranking the greatest albums of all time. The album features guest appearances from Bon Iver, Jay-Z, Pusha T, Rick Ross, Kid Cudi, <a href="https://www.last.fm/music/Kanye+West/My+Beautiful+Dark+Twisted+Fantasy">Read more on Last.fm</a>.', 'content': 'My Beautiful Dark Twisted Fantasy is the 2010, fifth studio album by American hip hop rapper and producer Kanye West. Following a period of public and legal controversy, West retreated to a "self-imposed exile" in Hawaii in 2009. There, he worked on the album in a communal recording environment that involved numerous contributing musicians and producers. A widespread critical success, it was named the best record of 2010 by many publications and has since appeared on several lists ranking the greatest albums of all time. The album features guest appearances from Bon Iver, Jay-Z, Pusha T, Rick Ross, Kid Cudi, Nicki Minaj, John Legend and more.

Production was led by West himself, alongside a variety of high-profile record producers including Mike Dean, No I.D., Jeff Bhasker, RZA, S1, Bink and DJ Frank E. Noted by critics for its maximalist aesthetic, opulent production quality, and dichotomous themes, My Beautiful Dark Twisted Fantasy incorporates aspects of West's previous works, including soul, baroque, electro, and symphonic styles. The album deals with themes of excess and celebrity, and explores such issues as consumer culture, race, and the idealism of the American Dream.

My Beautiful Dark Twisted Fantasy was released on November 22, 2010, by Roc-A-Fella Records. To promote the album, West released free songs through his GOOD Fridays series and four singles: the Billboard hits "Power", "Monster", and "Runaway", and the international hit "All of the Lights". It was also promoted with a short film set to the record's music, Runaway. The album debuted at number one on the Billboard 200 and eventually sold 1,032,000 copies in the United States. <a href="https://www.last.fm/music/Kanye+West/My+Beautiful+Dark+Twisted+Fantasy">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2008, 17:44', 'summary': 'Highway 61 Revisited is Bob Dylan's sixth studio album, released in 1965 by Columbia Records. It is Dylan's first album to be recorded entirely with a full rock band, after he experimented with the approach on half of Bringing It All Back Home. It is commonly tagged as documenting the "angry young man" period in Dylan's career, in-between the playfulness of its surrounding albums; many of the songs on Highway 61 are of an accusatory nature and feature rough, loud takes. Featuring hits and concert staples such as "Like a Rolling Stone", "Desolation Row", and "Ballad of a Thin Man", <a href="https://www.last.fm/music/Bob+Dylan/Highway+61+Revisited">Read more on Last.fm</a>.', 'content': 'Highway 61 Revisited is Bob Dylan's sixth studio album, released in 1965 by Columbia Records. It is Dylan's first album to be recorded entirely with a full rock band, after he experimented with the approach on half of Bringing It All Back Home. It is commonly tagged as documenting the "angry young man" period in Dylan's career, in-between the playfulness of its surrounding albums; many of the songs on Highway 61 are of an accusatory nature and feature rough, loud takes.

Featuring hits and concert staples such as "Like a Rolling Stone", "Desolation Row", and "Ballad of a Thin Man", it is also generally considered to be among the artist's best and most influential efforts. Dylan himself commented, "I'm not gonna be able to make a record better than that one... Highway 61 is just too good. There's a lot of stuff on there that I would listen to."

The album peaked at #3 on Billboard's Pop Albums chart and #4 in the UK, while "Like a Rolling Stone" reached #2 on the US Pop Singles chart and #4 in the UK, also receiving the accolade of being placed #1 on Rolling Stone's 500 Greatest Songs of All Time. The album itself was ranked #4 on Rolling Stone's 500 Greatest Albums of All Time. <a href="https://www.last.fm/music/Bob+Dylan/Highway+61+Revisited">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2017, 01:40', 'summary': 'Kid A is the fourth studio album by the English rock band Radiohead, released on 2 October 2000 by Parlophone. On the verge of a breakdown after promoting Radiohead's 1997 album OK Computer, songwriter Thom Yorke envisioned a radical change in direction. Radiohead replaced their rock sound with synthesisers, drum machines, the ondes Martenot, string orchestras and brass instruments, incorporating influences from genres such as electronic music, krautrock, jazz, and 20th-century classical music. They recorded Kid A with OK Computer producer Nigel Godrich in Paris, Copenhagen, Gloucestershire and their hometown Oxford, England. The sessions produced over 20 tracks; Radiohead saved <a href="https://www.last.fm/music/Radiohead/Kid+A">Read more on Last.fm</a>.', 'content': 'Kid A is the fourth studio album by the English rock band Radiohead, released on 2 October 2000 by Parlophone. On the verge of a breakdown after promoting Radiohead's 1997 album OK Computer, songwriter Thom Yorke envisioned a radical change in direction. Radiohead replaced their rock sound with synthesisers, drum machines, the ondes Martenot, string orchestras and brass instruments, incorporating influences from genres such as electronic music, krautrock, jazz, and 20th-century classical music. They recorded Kid A with OK Computer producer Nigel Godrich in Paris, Copenhagen, Gloucestershire and their hometown Oxford, England. The sessions produced over 20 tracks; Radiohead saved many of them for their subsequent album, Amnesiac, released the following year.

Radiohead released no singles or music videos to promote Kid A and conducted few interviews and photoshoots, instead becoming one of the first major acts to use the internet as a promotional tool. The album was made available to stream and was promoted with short animated films featuring music and artwork. Bootlegs of early performances were shared on filesharing services and the album was leaked before release.

Kid A debuted at the top of the charts in Britain, where it went platinum in the first week, and it became Radiohead's first number-one album in the United States. Like OK Computer, it won a Grammy for Best Alternative Album and was nominated for Album of the Year. Its departure from Radiohead's earlier sound initially divided fans and critics, but it later attracted widespread acclaim; at the turn of the decade, Rolling Stone, Pitchfork and the Times ranked Kid A the greatest album of the 2000s, and in 2012, Rolling Stone ranked it number 67 on its list of the 500 greatest albums of all time. <a href="https://www.last.fm/music/Radiohead/Kid+A">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 00:15', 'summary': 'Are You Experienced is the debut album by English/American rock band The Jimi Hendrix Experience. Released in 1967, it was the first LP for Track Records. The album highlighted Jimi Hendrix's R&B-based;, psychedelic, distortion-and feedback-laden electric guitar playing and launched him as a major new international star. Are You Experienced has remained a critical and commercial success since its release. The album reached #2 in the UK, behind The Beatles' Sgt. Pepper's Lonely Hearts Club Band. The US version of the album contains some of Hendrix's best known songs, including "Purple Haze", "Hey Joe", "The Wind Cries Mary" and "Fire". <a href="https://www.last.fm/music/The+Jimi+Hendrix+Experience/Are+You+Experienced">Read more on Last.fm</a>.', 'content': 'Are You Experienced is the debut album by English/American rock band The Jimi Hendrix Experience. Released in 1967, it was the first LP for Track Records. The album highlighted Jimi Hendrix's R&B-based;, psychedelic, distortion-and feedback-laden electric guitar playing and launched him as a major new international star. Are You Experienced has remained a critical and commercial success since its release. The album reached #2 in the UK, behind The Beatles' Sgt. Pepper's Lonely Hearts Club Band. The US version of the album contains some of Hendrix's best known songs, including "Purple Haze", "Hey Joe", "The Wind Cries Mary" and "Fire". In 1987, as part of their 20th anniversary, Rolling Stone magazine ranked it #5 on "The 100 Best Albums of the Last Twenty Years." In 2003, Rolling Stone magazine ranked it #15 on Rolling Stone's 500 Greatest Albums of All Time. The album was an instant success and was a best-selling album in the United States in 1968, and critics subsequently regarded it as one of the best rock albums of all time. In 2005 Are You Experienced was selected for permanent preservation in the National Recording Registry at the Library of Congress in the United States.

Hendrix, along with producer and former bass player for The Animals, Chas Chandler, formed the Jimi Hendrix Experience in England in 1966 with Mitch Mitchell on drums and Noel Redding on bass. The band signed with Track Records, a new label formed by The Who's managers Kit Lambert and Chris Stamp. They recorded three singles produced by Chas Chandler while simultaneously touring throughout England: "Hey Joe"/"Stone Free", which was released in December 1966 through Polydor Records because Track Records was not yet operational; "Purple Haze"/"51st Anniversary", released in March 1967 and was the first release by Track Records on a special white label; and "The Wind Cries Mary"/"Highway Chile" which was released in May 1967 and is said to be written by Hendrix for his longtime love, Kathy Etchingham (whose middle name is Mary), after he was left alone at home when she stormed out after a fight. All three of these singles reached the top ten in the UK. The Experience's first single, "Hey Joe", reached #6 on the UK chart in early 1967, followed soon after by "Purple Haze", which peaked at #3 on the charts and its double platinum debut album, Are You Experienced. During the making of these singles, the Jimi Hendrix Experience also cut the tracks that became their debut album, which Chandler produced, again, mostly with engineer Dave Siddle at De Lane Lea Studios, he also used Mike Ross at CBS for several tracks. Some tracks were finished at Olympic Sudios with engineer Eddie Kramer, as was the final compilation, mixing and editing of the LP.

The album was recorded over a five month period, but relative to his later work, little time was spent in the studio. According to the background information in the 180 gram vinyl re-release as of 2010, Hendrix stated he wanted to record with "the best gear and musicians available". <a href="https://www.last.fm/music/The+Jimi+Hendrix+Experience/Are+You+Experienced">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2020, 06:45', 'summary': 'Star Time is a 1991 71-track, 4-CD box set by James Brown. Its contents span most of the length of his career up to the time of its release, starting in 1956 with his first hit record, "Please, Please, Please", and ending with "Unity", his 1984 collaboration with Afrika Bambaataa. Writing in 2007, Robert Christgau described it as "the finest box set ever released... as essential a package as the biz has ever hawked, not just because it's James Brown, but because compilers Cliff White and Harry Weinger invested so much care and knowledge in it." Its title comes from <a href="https://www.last.fm/music/James+Brown/Star+Time">Read more on Last.fm</a>.', 'content': 'Star Time is a 1991 71-track, 4-CD box set by James Brown. Its contents span most of the length of his career up to the time of its release, starting in 1956 with his first hit record, "Please, Please, Please", and ending with "Unity", his 1984 collaboration with Afrika Bambaataa. Writing in 2007, Robert Christgau described it as "the finest box set ever released... as essential a package as the biz has ever hawked, not just because it's James Brown, but because compilers Cliff White and Harry Weinger invested so much care and knowledge in it." Its title comes from the question Brown's announcer would ask concert audiences, as heard on the album Live at the Apollo: "Are you ready for star time?"

Star Time's liner notes, written by Cliff White, Harry Weinger, Nelson George, Alan Leeds, and Brown himself, won a 1991 Grammy Award for Best Album Notes. The notes also include a discography and a one-page comic by Mary Fleener, a visual interpretation of the song "I Got You (I Feel Good)."

In 2003, the album was ranked number 79 on Rolling Stone magazine's list of the 500 greatest albums of all time. It was the second-highest ranking box set on the list. In 2012, the rank moved up to 75. <a href="https://www.last.fm/music/James+Brown/Star+Time">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

