{'published': '09 Sep 2008, 05:14', 'summary': 'Different Class is an album by English Britpop band Pulp. It was released in 1995 at the height of Britpop, and led to the band being regarded as part of that movement. Two of the singles on the album – "Common People" (which reached number two in the UK singles chart) and "Disco 2000" (which reached number seven) – were especially notable, and helped propel Pulp to nationwide fame. A "deluxe edition" of Different Class was released on 11 September 2006. It contains a second disc of B-sides, demos and rarities. The album was the winner of the 1996 Mercury <a href="https://www.last.fm/music/Pulp/Different+Class">Read more on Last.fm</a>.', 'content': 'Different Class is an album by English Britpop band Pulp. It was released in 1995 at the height of Britpop, and led to the band being regarded as part of that movement. Two of the singles on the album – "Common People" (which reached number two in the UK singles chart) and "Disco 2000" (which reached number seven) – were especially notable, and helped propel Pulp to nationwide fame. A "deluxe edition" of Different Class was released on 11 September 2006. It contains a second disc of B-sides, demos and rarities.

The album was the winner of the 1996 Mercury Music Prize. In 1998 Q readers voted Different Class the 37th greatest album of all time; a repeat poll in 2006 put it at number 85. In 2000 the same magazine placed it at number 46 in its list of the 100 Greatest British Albums Ever. In 2004 it was voted number 70 of Channel 4's 100 greatest albums. The album is also included in the book 1001 Albums You Must Hear Before You Die.

The album include the insert "Please do not read the lyrics whilst listening to the recordings", also included in anothers Pulp's albums. <a href="https://www.last.fm/music/Pulp/Different+Class">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2009, 12:51', 'summary': 'Can’t Buy a Thrill is the first album by Steely Dan. Originally released in 1972, the album was a huge success. It went gold, and then platinum, peaking at #17 on the charts. In 2003, the album was ranked number 238 on Rolling Stone magazine’s list of the 500 greatest albums of all time. Two songs were left out from the album and released as a single (“Dallas” and “Sail the Waterway”), but to date they have not been released on CD. The album was originally released in two-channel Stereo and also in a special four-channel Quadrophonic mix. There are <a href="https://www.last.fm/music/Steely+Dan/Can%27t+Buy+A+Thrill">Read more on Last.fm</a>.', 'content': 'Can’t Buy a Thrill is the first album by Steely Dan. Originally released in 1972, the album was a huge success. It went gold, and then platinum, peaking at #17 on the charts. In 2003, the album was ranked number 238 on Rolling Stone magazine’s list of the 500 greatest albums of all time. Two songs were left out from the album and released as a single (“Dallas” and “Sail the Waterway”), but to date they have not been released on CD.

The album was originally released in two-channel Stereo and also in a special four-channel Quadrophonic mix. There are some significant musical differences between the two mixes, such as extra lead guitar fills in the Quad mix of Reelin’ in the Years.

The album cover features a line of prostitutes standing in a red light area waiting for clients, an image which was chosen because of its relevance to the album title. The title is taken from a line from Bob Dylan’s song “It Takes a Lot to Laugh, It Takes a Train to Cry”. <a href="https://www.last.fm/music/Steely+Dan/Can%27t+Buy+A+Thrill">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '02 Feb 2019, 01:34', 'summary': 'Fear of a Black Planet is the third studio album by American hip hop group Public Enemy. It was released on April 10, 1990, by Def Jam Recordings and Columbia Records. For the album, Public Enemy's Bomb Squad production team sought to expand on the dense, sample-layered sound of the group's 1988 record It Takes a Nation of Millions to Hold Us Back. Having fulfilled their initial creative ambitions with that album, Public Enemy aspired to create what lead rapper Chuck D called "a deep, complex album". Their songwriting was partly inspired by the controversy surrounding member Professor Griff and <a href="https://www.last.fm/music/Public+Enemy/Fear+of+a+Black+Planet">Read more on Last.fm</a>.', 'content': 'Fear of a Black Planet is the third studio album by American hip hop group Public Enemy. It was released on April 10, 1990, by Def Jam Recordings and Columbia Records.

For the album, Public Enemy's Bomb Squad production team sought to expand on the dense, sample-layered sound of the group's 1988 record It Takes a Nation of Millions to Hold Us Back. Having fulfilled their initial creative ambitions with that album, Public Enemy aspired to create what lead rapper Chuck D called "a deep, complex album". Their songwriting was partly inspired by the controversy surrounding member Professor Griff and his dismissal from the group in 1989.

Fear of a Black Planet features elaborate sound collages that incorporate varying rhythms, numerous samples, media sound bites, and eccentric loops, reflecting the songs' confrontational tone. Recorded during the golden age of hip hop, its assemblage of reconfigured and recontextualized aural sources preceded the sample clearance system that later emerged in the music industry. Fear of a Black Planet explores themes of organization and empowerment within the black community, social issues affecting African Americans, and race relations at the time. The record's criticism of institutional racism, white supremacy, and the power elite was partly inspired by Dr. Frances Cress Welsing's views on color. <a href="https://www.last.fm/music/Public+Enemy/Fear+of+a+Black+Planet">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 21:57', 'summary': 'Otis Blue: Otis Redding Sings Soul, or simply Otis Blue, released September 15, 1965 on Stax Records, is the third studio album by soul singer Otis Redding. The album mainly consists of cover songs by popular R&B and soul artists, and, bar one track, was recorded in a 24-hour period over July 9/10 1965 at the Stax Recording Studios in Memphis, Tennessee. Otis Blue was critically acclaimed upon release and became one of Redding’s most successful albums; it reached number 6 on the UK Albums Chart, and was his first to reach the top spot of the Billboard R&B chart. <a href="https://www.last.fm/music/Otis+Redding/Otis+Blue:+Otis+Redding+Sings+Soul">Read more on Last.fm</a>.', 'content': 'Otis Blue: Otis Redding Sings Soul, or simply Otis Blue, released September 15, 1965 on Stax Records, is the third studio album by soul singer Otis Redding. The album mainly consists of cover songs by popular R&B and soul artists, and, bar one track, was recorded in a 24-hour period over July 9/10 1965 at the Stax Recording Studios in Memphis, Tennessee. Otis Blue was critically acclaimed upon release and became one of Redding’s most successful albums; it reached number 6 on the UK Albums Chart, and was his first to reach the top spot of the Billboard R&B chart. Furthermore, it produced three popular singles, all charting at least in the top 50 on both the Billboard R&B and the Billboard Hot 100 chart. It is considered by many critics to be Redding’s first fully realized album.

Three of the eleven songs were written by Redding: “Ole Man Trouble”, “Respect”, and “I’ve Been Loving You Too Long”. Three songs were written by Sam Cooke, a soul musician who had died a few months earlier. As was the case in the previous albums, Redding was backed by house band Booker T. & the M.G.’s, a horn section of members of The Mar-Keys and The Memphis Horns, and pianist Isaac Hayes.

Otis Blue is included in a number of “best album” lists, including Rolling Stone’s 500 Greatest Albums of All Time, Time magazine’s list of the All-Time 100 Greatest Albums, and Robert Dimery’s “1001 Albums You Must Hear Before You Die”.  <a href="https://www.last.fm/music/Otis+Redding/Otis+Blue:+Otis+Redding+Sings+Soul">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 03:26', 'summary': 'Sweet Baby James is singer-songwriter James Taylor's second album, and his first release on Warner Bros. Records. Released in February 1970, it showcased Taylor's talents and showed the direction he would take in the early 1970s with the expansion of his career. The album featured one of Taylor's earliest single successes: "Fire and Rain", which reached #3 on the Billboard Hot 100. The album itself also managed to reach #3 on the Billboard Album Charts. Sweet Baby James made Taylor one of the main forces of the ascendent folk movement. The album was nominated to a Grammy Award for Album <a href="https://www.last.fm/music/James+Taylor/Sweet+Baby+James">Read more on Last.fm</a>.', 'content': 'Sweet Baby James is singer-songwriter James Taylor's second album, and his first release on Warner Bros. Records. Released in February 1970, it showcased Taylor's talents and showed the direction he would take in the early 1970s with the expansion of his career. The album featured one of Taylor's earliest single successes: "Fire and Rain", which reached #3 on the Billboard Hot 100. The album itself also managed to reach #3 on the Billboard Album Charts. Sweet Baby James made Taylor one of the main forces of the ascendent folk movement. The album was nominated to a Grammy Award for Album of the Year, in 1971. The album was listed at #103 on Rolling Stone's 500 Greatest Albums of All Time.

The album, produced by Peter Asher, was recorded between 8 and 17 December 1969 at a cost of only $7,600 out of a budget of $20,000. Taylor was "essentially homeless" at the time the album was recorded, either staying in Asher's home or crashing on a couch at the house of guitarist Danny Kortchmar or anyone else who would have him.

The song "Suite for 20 G" was so named because Taylor was promised $20,000 once the album was delivered. With one more song needed, he strung together three unfinished songs into a "suite," and completed the album. <a href="https://www.last.fm/music/James+Taylor/Sweet+Baby+James">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2010, 07:34', 'summary': 'Diamond Life is Sade's debut album. Released two years after the group formed in 1982, it is a modern soul classic. Although initially not a big seller, the album was catapulted into the spotlight once the track "Your Love Is King" went top ten and it eventually went on to achieve an astonishing 4x platinum certification in both the UK and US, selling more than seven million copies worldwide. It won a 'Best Album' BRIT Award, and spawned some of Sade's most well-loved singles - Your Love Is King, Smooth Operator, When Am I Going To Make A Living and <a href="https://www.last.fm/music/Sade/Diamond+Life">Read more on Last.fm</a>.', 'content': 'Diamond Life is Sade's debut album. Released two years after the group formed in 1982, it is a modern soul classic.

Although initially not a big seller, the album was catapulted into the spotlight once the track "Your Love Is King" went top ten and it eventually went on to achieve an astonishing 4x platinum certification in both the UK and US, selling more than seven million copies worldwide. It won a 'Best Album' BRIT Award, and spawned some of Sade's most well-loved singles - Your Love Is King, Smooth Operator, When Am I Going To Make A Living and Hang On To Your Love.

Diamond Life was also highly successful in Germany, Switzerland and Austria, where it reached number one for nine, eight and five weeks, respectively. <a href="https://www.last.fm/music/Sade/Diamond+Life">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2012, 12:02', 'summary': 'Pink Moon is the third and final album by English musician Nick Drake. It was recorded at midnight in two separate two-hour sessions, over two days in October 1971, featuring only Nick Drake's vocals and guitar, as well as some piano later overdubbed by Drake on the title track. Initially, Pink Moon garnered a small amount of critical attention, but decades after Drake's death it received widespread public and critical acclaim. The music on Pink Moon is sparse and unadorned (especially in comparison to Drake's previous recordings), leading some to consider it to be the least accessible of his three <a href="https://www.last.fm/music/Nick+Drake/Pink+Moon">Read more on Last.fm</a>.', 'content': 'Pink Moon is the third and final album by English musician Nick Drake. It was recorded at midnight in two separate two-hour sessions, over two days in October 1971, featuring only Nick Drake's vocals and guitar, as well as some piano later overdubbed by Drake on the title track.

Initially, Pink Moon garnered a small amount of critical attention, but decades after Drake's death it received widespread public and critical acclaim. The music on Pink Moon is sparse and unadorned (especially in comparison to Drake's previous recordings), leading some to consider it to be the least accessible of his three albums, though it nevertheless continues to be thought of by many of his fans as his greatest work.

The cover of the album features an illustration by the partner of Drake's sister Gabrielle, Michael Trevithick. <a href="https://www.last.fm/music/Nick+Drake/Pink+Moon">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2021, 00:18', 'summary': 'Either/Or is the third studio album by American singer-songwriter Elliott Smith. Either/Or was recorded in several locations, mostly in Portland, Oregon – while Smith was still a member of Heatmiser – and was produced by Smith, Tom Rothrock and Rob Schnapf. It was released on February 25, 1997 through Kill Rock Stars record label, following Heatmiser's dissolution. Book-ended by its two singles, Speed Trials and Ballad of Big Nothing, Either/Or did not chart in the US, but was acclaimed by critics. It has been described as "a bridge between the lo-fi darkness of Roman Candle and Elliott Smith and the <a href="https://www.last.fm/music/Elliott+Smith/Either%2FOr">Read more on Last.fm</a>.', 'content': 'Either/Or is the third studio album by American singer-songwriter Elliott Smith. Either/Or was recorded in several locations, mostly in Portland, Oregon – while Smith was still a member of Heatmiser – and was produced by Smith, Tom Rothrock and Rob Schnapf. It was released on February 25, 1997 through Kill Rock Stars record label, following Heatmiser's dissolution. Book-ended by its two singles, Speed Trials and Ballad of Big Nothing, Either/Or did not chart in the US, but was acclaimed by critics. It has been described as "a bridge between the lo-fi darkness of Roman Candle and Elliott Smith and the studio sheen of XO and Figure 8".

The album's title derives from the Søren Kierkegaard book of the same name, in which "either/or" refers to the contrast between aesthetic/subjective experience and ethical/objective being. This existential title is reflective of Smith's interest in philosophy, which he studied at Hampshire College in Massachusetts.

Director Gus Van Sant was highly impressed with the album, incorporating three of its songs; Between the Bars, Angeles and Say Yes along with a new song, Miss Misery, into the Good Will Hunting soundtrack. Miss Misery was nominated for Best Original Song at the 1998 Academy Awards, and was performed at the televised ceremony in an abridged version by Smith, backed by the house orchestra, briefly propelling him into the international spotlight. Online magazine Pitchfork ranked Either/Or 59th in its list of the 100 greatest albums of the 1990s. Spin ranked Either/Or at number 48 on its list of the best albums from 1987 to 2012. Blender ranked it thirty-sixth in its "100 Greatest Indie Rock Albums Ever" list. In 2013, NME placed Either/Or at number 149 on its list of the 500 Greatest Albums of All Time. Consequence of Sound ranked the album No. 97 on their list of best albums ever. Rolling Stone ranked the album at 216 on the 2020 re-release of their 'The 500 Greatest Albums of All Time' list. <a href="https://www.last.fm/music/Elliott+Smith/Either%2FOr">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2010, 15:43', 'summary': 'Damn the Torpedoes is the third album by Tom Petty and the Heartbreakers released in 1979 by MCA Records. It was released to commercial success and critical acclaim becoming the band's breakthrough album. In 2003, the album was ranked number 313 on Rolling Stone magazine's list of the 500 greatest albums of all time. Damn the Torpedoes was the Heartbreakers first for MCA Records. Their old label, Shelter, had been sold to MCA. Petty struggled to legally detach himself from MCA, resulting in his bankruptcy. In the end the record company backed down, and he negotiated a deal that allowed <a href="https://www.last.fm/music/Tom+Petty+and+The+Heartbreakers/Damn+the+Torpedoes">Read more on Last.fm</a>.', 'content': 'Damn the Torpedoes is the third album by Tom Petty and the Heartbreakers released in 1979 by MCA Records. It was released to commercial success and critical acclaim becoming the band's breakthrough album. In 2003, the album was ranked number 313 on Rolling Stone magazine's list of the 500 greatest albums of all time.

Damn the Torpedoes was the Heartbreakers first for MCA Records. Their old label, Shelter, had been sold to MCA. Petty struggled to legally detach himself from MCA, resulting in his bankruptcy. In the end the record company backed down, and he negotiated a deal that allowed him to release his recordings on the new Backstreet Records label, manufactured and distributed by MCA. The album was recorded at Sound City in Van Nuys and Cherokee Studios in Hollywood. The title is a reference to a famous quote by Admiral David Farragut: "Damn the torpedoes, full speed ahead!".

Damn the Torpedoes was released in October of 1979. The album was a breakthrough for Petty and the Heartbreakers. It was his first top 10 album rising to #2 hit (for seven weeks and kept from #1 by Pink Floyd's The Wall) on the Billboard's Albums chart. It yielded two songs that made the top-fifteen on the Billboard Hot 100  singles chart, "Don't Do Me Like That" (#10) and "Refugee" (#15). It was a commercial success as well. Thanks to the new co-producer Jimmy Iovine, Damn the Torpedoes proved to be a major leap forward in production. <a href="https://www.last.fm/music/Tom+Petty+and+The+Heartbreakers/Damn+the+Torpedoes">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2020, 11:38', 'summary': 'Criminal Minded is the debut studio album by hip hop music group Boogie Down Productions, released on March 3, 1987 by B-Boy Records. It is considered a highly influential hip hop album and one of the first in the gangsta rap genre. Since its release, the album has been sampled, interpolated and paraphrased. Its samples and direct influences were unusual at the time, ranging from liberal use of dancehall reggae (as well as the more commonly used James Brown) to rock music artists such as AC/DC, The Beatles and Billy Joel. The album was eventually certified Gold by the RIAA. <a href="https://www.last.fm/music/Boogie+Down+Productions/Criminal+Minded">Read more on Last.fm</a>.', 'content': 'Criminal Minded is the debut studio album by hip hop music group Boogie Down Productions, released on March 3, 1987 by B-Boy Records. It is considered a highly influential hip hop album and one of the first in the gangsta rap genre.

Since its release, the album has been sampled, interpolated and paraphrased. Its samples and direct influences were unusual at the time, ranging from liberal use of dancehall reggae (as well as the more commonly used James Brown) to rock music artists such as AC/DC, The Beatles and Billy Joel. The album was eventually certified Gold by the RIAA. The songs "South Bronx" and "The Bridge Is Over" ignited the rivalry with the Brooklyn-bred but Queens resident emcee MC Shan and the Juice Crew. The former has second-hand musical ideas from Public Enemy and contributed to the new jack swing genre. The latter took ideas from MC Shan. Throughout the album, KRS-One gives honor and praise to Scott La Rock for producing the album and he mostly goes on about the importance of originality and being "real" instead of a "Sucker MC".

In 2003, the album was ranked number 444 on Rolling Stone magazine's list of the 500 greatest albums of all time. <a href="https://www.last.fm/music/Boogie+Down+Productions/Criminal+Minded">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '04 Apr 2018, 06:52', 'summary': 'Whitney Houston is the debut studio album by American contemporary R&B and pop singer Whitney Houston. It was released on February 14, 1985, by Arista Records. The album initially had a slow commercial response, but began getting more popular in the summer of 1985. It eventually topped the Billboard 200 for 14 weeks in 1986, generating three number-one singles — "Saving All My Love for You", "How Will I Know" and "Greatest Love of All" (a cover of "The Greatest Love of All", originally recorded in 1977 by George Benson) — on the Billboard Hot 100 chart, which made it <a href="https://www.last.fm/music/Whitney+Houston/Whitney+Houston">Read more on Last.fm</a>.', 'content': 'Whitney Houston is the debut studio album by American contemporary R&B and pop singer Whitney Houston. It was released on February 14, 1985, by Arista Records. The album initially had a slow commercial response, but began getting more popular in the summer of 1985. It eventually topped the Billboard 200 for 14 weeks in 1986, generating three number-one singles — "Saving All My Love for You", "How Will I Know" and "Greatest Love of All" (a cover of "The Greatest Love of All", originally recorded in 1977 by George Benson) — on the Billboard Hot 100 chart, which made it both the first debut album and the first album by a solo female artist to produce three number-one singles. The album topped the albums charts in many countries, including Canada, Australia, Norway and Sweden, peaking at number 2 in the United Kingdom, Germany, and Switzerland. The album was certified diamond for shipments of 10 million units or more on March 16, 1999, and later 13× platinum by the Recording Industry Association of America on July 29, 1999, making it one of the top 100 best-selling albums in the United States. It has sold over 22 million copies worldwide.

In 1986, at the 28th Grammy Awards, Whitney Houston received four nominations; including Album of the Year  and won one, Best Pop Vocal Performance, Female for "Saving All My Love For You".  For the 29th Grammy Awards of 1987, the album received a Record of the Year nomination for "Greatest Love of All".  In 2003, the album was ranked 254 on the Rolling Stone magazine list of the 500 best albums of all time and this album appears at number 46 on the list of 200 definitive albums in the Rock and Roll Hall of Fame. 

In honor of its 25th anniversary, the album was reissued as Whitney Houston – The Deluxe Anniversary Edition on January 26, 2010, an expanded edition with five bonus tracks including the a cappella version of "How Will I Know" and the original 12-inch remixes, a booklet tracking the history of the original album, along with a DVD of live performances and interviews by Whitney Houston and Clive Davis. <a href="https://www.last.fm/music/Whitney+Houston/Whitney+Houston">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '06 Jun 2020, 15:15', 'summary': 'Honky Château is the fifth studio album by English musician Elton John. It was released in 1972, and was titled after the 18th century French chateau where it was recorded, Château d'Hérouville. The album reached number one in the US, the first of John's seven consecutive US number one albums. In 2012, the album was ranked number 359 on Rolling Stone magazine's list of the 500 greatest albums of all time. It was certified gold in July 1972 and platinum in October 1995 by the RIAA. This was the final Elton John album on the Uni label in the US <a href="https://www.last.fm/music/Elton+John/Honky+Ch%C3%A2teau">Read more on Last.fm</a>.', 'content': 'Honky Château is the fifth studio album by English musician Elton John. It was released in 1972, and was titled after the 18th century French chateau where it was recorded, Château d'Hérouville. The album reached number one in the US, the first of John's seven consecutive US number one albums.

In 2012, the album was ranked number 359 on Rolling Stone magazine's list of the 500 greatest albums of all time. It was certified gold in July 1972 and platinum in October 1995 by the RIAA. This was the final Elton John album on the Uni label in the US and Canada before MCA consolidated all of its various labels under the MCA brand. This and John's earlier Uni albums were later reissued on MCA Records.

Two singles were released worldwide from Honky Château, "Rocket Man" and "Honky Cat" A third single, "Hercules," was prepared for release, but this never materialised. <a href="https://www.last.fm/music/Elton+John/Honky+Ch%C3%A2teau">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '09 Sep 2016, 23:27', 'summary': 'Q: Are We Not Men? A: We Are Devo! is the debut studio album by the American new wave band Devo. It was originally released in August 1978, on the labels Warner Bros., and Virgin. Produced by Brian Eno, the album was recorded over a period of four months between October 1977 and February 1978, primarily in Cologne, Germany, The album received somewhat mixed reviews from critics and peaked at number 12 on the UK Albums Chart and number 78 on the U.S. Billboard chart. Recent reviews of the album have been more uniformly positive, and the album has charted <a href="https://www.last.fm/music/Devo/Q:+Are+We+Not+Men%3F+A:+We+Are+Devo!">Read more on Last.fm</a>.', 'content': 'Q: Are We Not Men? A: We Are Devo! is the debut studio album by the American new wave band Devo. It was originally released in August 1978, on the labels Warner Bros., and Virgin. Produced by Brian Eno, the album was recorded over a period of four months between October 1977 and February 1978, primarily in Cologne, Germany,

The album received somewhat mixed reviews from critics and peaked at number 12 on the UK Albums Chart and number 78 on the U.S. Billboard chart. Recent reviews of the album have been more uniformly positive, and the album has charted on several retrospective "best of" lists from publications including Rolling Stone, Pitchfork Media and Spin.

On May 6, 2009 Devo performed the album live in its entirety for the first time as part of the Don't Look Back concert series curated by All Tomorrow's Parties. On September 16, 2009, Warner Bros. and Devo announced a re-release of Q: Are We Not Men? and Freedom of Choice, with a tour performing both albums. <a href="https://www.last.fm/music/Devo/Q:+Are+We+Not+Men%3F+A:+We+Are+Devo!">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2021, 04:10', 'summary': 'Pearl is the second and final solo studio album by Janis Joplin, released on January 11, 1971, three months after her death on October 4, 1970. It was the final album with her direct participation, and the only Joplin album recorded with the Full Tilt Boogie Band, her final touring unit. It peaked at number one on the Billboard 200, holding that spot for nine weeks. It has been certified quadruple platinum by the RIAA. All nine tracks that she sings on were personally approved and arranged by Joplin. Joplin sang on all tracks except Buried Alive in the Blues, <a href="https://www.last.fm/music/Janis+Joplin/Pearl">Read more on Last.fm</a>.', 'content': 'Pearl is the second and final solo studio album by Janis Joplin, released on January 11, 1971, three months after her death on October 4, 1970. It was the final album with her direct participation, and the only Joplin album recorded with the Full Tilt Boogie Band, her final touring unit. It peaked at number one on the Billboard 200, holding that spot for nine weeks. It has been certified quadruple platinum by the RIAA.

All nine tracks that she sings on were personally approved and arranged by Joplin. Joplin sang on all tracks except Buried Alive in the Blues, which was actually a backing track in which she had not yet recorded vocals. The song's writer Nick Gravenites was offered the opportunity to sing it as a tribute to Joplin, but he turned it down, and as a result, the song ended up as an instrumental. The recording sessions, starting in early September, ended with Joplin's untimely death on October 4, 1970. Her final session, which took place on Thursday, October 1 after a break of several days, yielded her a cappella Mercedes Benz. It was the last song she recorded before her death.

The album cover, photographed by Barry Feinstein in Los Angeles, shows Joplin reclining on her Victorian era loveseat with a drink in her hand. <a href="https://www.last.fm/music/Janis+Joplin/Pearl">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2020, 01:53', 'summary': 'Weezer (commonly known as the Blue Album) is the eponymous debut studio album by American rock band Weezer, released on May 10, 1994 by DGC Records. The album came two years after the band's founding, after they initially struggled as an alternative to grunge music, which was prevalent in Los Angeles during the early 1990s. It was almost entirely arranged and composed by frontman Rivers Cuomo, who also anticipated to lead the band in self-producing the album. However, at the behest of DGC, the band was required to include a producer, and collectively opted for Cars frontman Ric Ocasek. Most <a href="https://www.last.fm/music/Weezer/Weezer+(Blue+Album)">Read more on Last.fm</a>.', 'content': 'Weezer (commonly known as the Blue Album) is the eponymous debut studio album by American rock band Weezer, released on May 10, 1994 by DGC Records. The album came two years after the band's founding, after they initially struggled as an alternative to grunge music, which was prevalent in Los Angeles during the early 1990s. It was almost entirely arranged and composed by frontman Rivers Cuomo, who also anticipated to lead the band in self-producing the album. However, at the behest of DGC, the band was required to include a producer, and collectively opted for Cars frontman Ric Ocasek. Most of the recording was conducted at Electric Lady Studios in New York City between August and September 1993, a period that coincided with founding guitarist Jason Cropper being fired and replaced by Brian Bell.

Under Ocasek's direction, the band opted for a brighter sound, while bassist Matt Sharp collaborated with Cuomo to ensure that the album contained an overriding sonic concept of treating the guitars and bass as isolated ten-string instruments, thus maximizing its potential when united. Lyrically, Weezer focuses on outsiderdom and social awkwardness, while also touching on melancholic themes of love, romance, and familial issues.

Weezer was supported by the singles "Undone – The Sweater Song", "Buddy Holly", and "Say It Ain't So", which, alongside their respective music videos, brought Weezer mainstream success. The album itself peaked at number sixteen on the US Billboard 200, and was certified triple platinum by 1995. It is also the band's best-selling album, having sold at least 3.3 million copies in the U.S. and over fifteen million copies worldwide by 2009. <a href="https://www.last.fm/music/Weezer/Weezer+(Blue+Album)">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '02 Feb 2021, 20:55', 'summary': 'Random Access Memories is the fourth and final studio album by French electronic music duo Daft Punk. It was released by Daft Life under exclusive license to Columbia Records on May 17, 2013 in Australia, May 20, 2013 in the United Kingdom and on May 21, 2013 in the United States. Work started on the record concurrently with the Tron: Legacy score, without a clear plan as to what its structure would be. Shortly after Daft Punk signed with Columbia, a gradual promotional rollout began for the album including billboards, television advertising and a web series. Random Access Memories pays <a href="https://www.last.fm/music/Daft+Punk/Random+Access+Memories">Read more on Last.fm</a>.', 'content': 'Random Access Memories is the fourth and final studio album by French electronic music duo Daft Punk. It was released by Daft Life under exclusive license to Columbia Records on May 17, 2013 in Australia, May 20, 2013 in the United Kingdom and on May 21, 2013 in the United States. Work started on the record concurrently with the Tron: Legacy score, without a clear plan as to what its structure would be. Shortly after Daft Punk signed with Columbia, a gradual promotional rollout began for the album including billboards, television advertising and a web series.

Random Access Memories pays tribute to the late 1970s and early 80s era of music in the United States, particularly the sound of Los Angeles recordings of the period. Daft Punk recorded the album largely using live instrumentation with session musicians, and limited the use of electronics to drum machines, a modular synthesizer and vintage vocoders. The album also features collaborations with Panda Bear, Julian Casablancas, Todd Edwards, DJ Falcon, Chilly Gonzales, Giorgio Moroder, Nile Rodgers, Paul Williams and Pharrell Williams. Critical reception to the album has generally been positive.

This production won Grammy's Album of the Year in 2013, Record for the Year and Best Pop Duo/Group Performance for "Get Lucky", Best Dance/Electro Album & Best Engineered Album (non-classical). <a href="https://www.last.fm/music/Daft+Punk/Random+Access+Memories">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '04 Apr 2020, 15:56', 'summary': 'New York Dolls is the debut album by the American hard rock band New York Dolls. It was released on July 27, 1973, by Mercury Records. In the years leading up to the album, the Dolls had developed a local fanbase by playing regularly in lower Manhattan after forming in 1971. New York Dolls was met with widespread critical acclaim but sold poorly and polarized listeners. Despite its commercial failure, New York Dolls was an influential precursor to the 1970s punk rock movement as the group's crude musicianship and youthful attitude on the album threatened the prevailing trend of musical <a href="https://www.last.fm/music/New+York+Dolls/New+York+Dolls">Read more on Last.fm</a>.', 'content': 'New York Dolls is the debut album by the American hard rock band New York Dolls. It was released on July 27, 1973, by Mercury Records.

In the years leading up to the album, the Dolls had developed a local fanbase by playing regularly in lower Manhattan after forming in 1971.

New York Dolls was met with widespread critical acclaim but sold poorly and polarized listeners. Despite its commercial failure, New York Dolls was an influential precursor to the 1970s punk rock movement as the group's crude musicianship and youthful attitude on the album threatened the prevailing trend of musical sophistication in popular music, particularly progressive rock. Among the most acclaimed albums in history, it has since been named in various publications as one of the best debut records in rock music and one of the greatest albums of all time. <a href="https://www.last.fm/music/New+York+Dolls/New+York+Dolls">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '06 Jun 2021, 00:43', 'summary': 'Here Come the Warm Jets is the debut solo album by British musician Brian Eno, released on Island Records in January 1974. It was recorded and produced by Eno following his departure from the band Roxy Music, and blends glam and pop stylings with avant-garde approaches. The album features numerous guests, including three of Eno's former Roxy bandmates (guitarist Phil Manzanera, saxophonist/keyboardist Andy Mackay and drummer Paul Thompson), drummer Simon King (of Hawkwind), bassist Bill MacCormick (of Matching Mole), guitarist/bassist Paul Rudolph (of Pink Fairies) and guitarist Robert Fripp and bassist John Wetton (both of King Crimson). Notable contributions were <a href="https://www.last.fm/music/Brian+Eno/Here+Come+the+Warm+Jets">Read more on Last.fm</a>.', 'content': 'Here Come the Warm Jets is the debut solo album by British musician Brian Eno, released on Island Records in January 1974. It was recorded and produced by Eno following his departure from the band Roxy Music, and blends glam and pop stylings with avant-garde approaches. The album features numerous guests, including three of Eno's former Roxy bandmates (guitarist Phil Manzanera, saxophonist/keyboardist Andy Mackay and drummer Paul Thompson), drummer Simon King (of Hawkwind), bassist Bill MacCormick (of Matching Mole), guitarist/bassist Paul Rudolph (of Pink Fairies) and guitarist Robert Fripp and bassist John Wetton (both of King Crimson). Notable contributions were also made by guitarist Chris Spedding, bassist Busta Jones, percussionist Marty Simon, and gospel vocal group Sweetfeed. In developing the material with the various musicians, Eno devised unusual methods and instructions to obtain unexpected results

Here Come the Warm Jets peaked at number 26 on the United Kingdom album charts and number 151 on the US Billboard charts, receiving mostly positive reviews. It was re-issued on compact disc in 1990 on Island Records and remastered in 2004 on Virgin Records, and continued to elicit praise.

Initial critical reception for the album was mostly positive, with praise focused on its experimental tendencies. Critic Lester Bangs of Creem declared it "incredible," and noted that "the predominant feel is a strange mating of edgy dread with wild first-time-out exuberance." Robert Christgau of The Village Voice gave it an "A" rating, stating that "The idea of this record—top of the pops from quasi-dadaist British synth wizard—may put you off, but the actuality is quite engaging in a vaguely Velvet Underground kind of way." Billboard wrote a positive review, stating that "... while it all may be a bit unpredictable, and may be a longshot to do much in the U.S. market, it is an excellent LP." The album was also placed in Circus magazine's section for "Picks of the Month". Cynthia Dagnal of Rolling Stone wrote an article on Eno, calling the album "a very compelling experiment in controlled chaos and by his own self-dictated standards a near success." Steve Huey of AllMusic stated that the album "still sounds exciting, forward-looking, and densely detailed, revealing more intricacies with every play". In 1991, Select writer David Cavanagh described it as a "classic" album of "mind-blowing diversity". In 2003, the album placed at number 436 in Rolling Stone's list of the "500 Greatest Albums of All Time", climbing to number 432 in the 2012 update and to number 308 in the 2020 edition. In a retrospective review, Rolling Stone's J. D. Considine commented that "It may be easy to hear both an anticipation of punk and an echo of Roxy Music in the arch clangor of Here Come the Warm Jets, but what shines brightest is the offhand accessibility of the songs", adding that "the melodies linger on... the album seems almost a blueprint for the pop experiments Bowie (with Eno collaborating) would conduct with Low". In 2004, Pitchfork ranked the album at number 24 on its "Top 100 Albums of the 1970s" list. In 2003, Blender placed the album on its list "500 CDs You Must Own: Alternative Rock", stating that Here Come the Warm Jets "remains his best pop effort. His experimental touch turns basic glam-rock into something sick and sinister. The free-associating, posh-voiced vocals are an acquired taste, but there's method in this madness". The Canadian music magazine Exclaim! referred to Here Come the Warm Jets as "Arguably one of the greatest solo debuts of the 1970s... Songs such as "Baby's on Fire", "Driving Me Backwards" and "Needles in the Camel's Eye" capture the lush and sleazy underpinning narratives of the British Invasion in arrangements that sound quintessentially timeless". In 2012, Treble named the album in the list "10 Essential Glam Rock Albums." <a href="https://www.last.fm/music/Brian+Eno/Here+Come+the+Warm+Jets">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '03 Mar 2021, 02:05', 'summary': 'Pink Flag is the first studio album by the English band Wire. It was released in November 1977 by Harvest Records. Though the album failed to chart on its initial release, it has been widely considered to have been highly influential on many other musicians. Upon its release, Robert Christgau of The Village Voice called Pink Flag a "punk suite" and praised its "simultaneous rawness and detachment" and detected a rock-and-roll irony similar to but "much grimmer and more frightening" than the Ramones. In a retrospective review, Steve Huey of AllMusic opined that Pink Flag was "perhaps the most original <a href="https://www.last.fm/music/Wire/Pink+Flag">Read more on Last.fm</a>.', 'content': 'Pink Flag is the first studio album by the English band Wire. It was released in November 1977 by Harvest Records. Though the album failed to chart on its initial release, it has been widely considered to have been highly influential on many other musicians.

Upon its release, Robert Christgau of The Village Voice called Pink Flag a "punk suite" and praised its "simultaneous rawness and detachment" and detected a rock-and-roll irony similar to but "much grimmer and more frightening" than the Ramones.

In a retrospective review, Steve Huey of AllMusic opined that Pink Flag was "perhaps the most original debut album to come out of the first wave of British punk" and also "recognizable, yet simultaneously quite unlike anything that preceded it. Pink Flag's enduring influence pops up in hardcore, post-punk, alternative rock, and even Britpop, and it still remains a fresh, invigorating listen today: a fascinating, highly inventive rethinking of punk rock and its freedom to make up your own rules." Trouser Press called the album "a brilliant 21-song suite" in which the band "manipulated classic rock song structure by condensing them into brief, intense explosions of attitude and energy, coming up with a collection of unforgettable tunes" <a href="https://www.last.fm/music/Wire/Pink+Flag">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

