{'published': '01 Jan 2013, 22:06', 'summary': 'Aftermath, first released on 15 April 1966 by Decca Records, is the fourth British studio album by The Rolling Stones. It was released in the United States on 20 June 1966 by London Records as their sixth American album. The album proved to be a major artistic breakthrough for the band, being the first full-length release by the band to consist exclusively of Mick Jagger/Keith Richards compositions. Aftermath was also the first Rolling Stones album to be recorded entirely in the US, at the legendary RCA Studios in Hollywood, California at 6363 Sunset Boulevard, and the first album the band <a href="https://www.last.fm/music/The+Rolling+Stones/Aftermath">Read more on Last.fm</a>.', 'content': 'Aftermath, first released on 15 April 1966 by Decca Records, is the fourth British studio album by The Rolling Stones. It was released in the United States on 20 June 1966 by London Records as their sixth American album. The album proved to be a major artistic breakthrough for the band, being the first full-length release by the band to consist exclusively of Mick Jagger/Keith Richards compositions. Aftermath was also the first Rolling Stones album to be recorded entirely in the US, at the legendary RCA Studios in Hollywood, California at 6363 Sunset Boulevard, and the first album the band released in true stereo.

The album is also notable for its musical experimentation, with Brian Jones playing a variety of instruments not usually associated with rock music—including sitar on "Paint It, Black" and "Mother's Little Helper", the Appalachian dulcimer on "Lady Jane" and "I Am Waiting", the marimbas (African xylophone) on "Under My Thumb" and "Out of Time", harmonica on "High and Dry" and "Goin' Home", as well as guitar and keyboards. Much of the music was still rooted in Chicago electric blues.

In August 2002 both editions of Aftermath were reissued in a new remastered CD and SACD digipak by ABKCO Records. <a href="https://www.last.fm/music/The+Rolling+Stones/Aftermath">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '12 Dec 2018, 01:04', 'summary': 'Janet Jackson's Rhythm Nation 1814 (commonly referred to as Rhythm Nation) is the fourth studio album by American singer Janet Jackson, released on September 19, 1989, by A&M Records. Although label executives wanted material similar to her previous album, Control (1986), Jackson insisted on creating a concept album addressing social issues. Collaborating with songwriters and record producers Jimmy Jam and Terry Lewis, she drew inspiration from various tragedies reported through news media, exploring racism, poverty, and substance abuse, in addition to themes of romance. Although its primary concept was met with mixed reactions, its composition received critical acclaim. Jackson came <a href="https://www.last.fm/music/Janet+Jackson/Rhythm+Nation+1814">Read more on Last.fm</a>.', 'content': 'Janet Jackson's Rhythm Nation 1814 (commonly referred to as Rhythm Nation) is the fourth studio album by American singer Janet Jackson, released on September 19, 1989, by A&M Records. Although label executives wanted material similar to her previous album, Control (1986), Jackson insisted on creating a concept album addressing social issues. Collaborating with songwriters and record producers Jimmy Jam and Terry Lewis, she drew inspiration from various tragedies reported through news media, exploring racism, poverty, and substance abuse, in addition to themes of romance. Although its primary concept was met with mixed reactions, its composition received critical acclaim. Jackson came to be considered a role model for youth because of her socially conscious lyrics.

Noted for its use of sample loop and utilizing swing note and synthesized percussion throughout its production, the album encompasses a variety of musical styles, such as new jack swing, hard rock, pop, dance and industrial music. The songs range from mechanized dance rhythms to soft balladry, giving it appeal across multiple radio formats. It became the singer's second consecutive album to top the Billboard 200 albums chart in the United States. Certified six-times platinum by the Recording Industry Association of America (RIAA), it became the country's best-selling album of 1990 and has sold an estimated 12 million copies worldwide. Due to its innovative production and lyrical exploration, critics have come to regard it as the pinnacle of Jackson's artistic achievement. It has been cited as an influence in various musical trends, inspiring numerous artists.

It is the only album in the history of the US Billboard Hot 100 singles chart to have seven commercial singles peak within the top five positions. It is also the only album to produce number one hits on the chart in three separate calendar years (1989–1991). The 30-minute Rhythm Nation 1814 film, a screenplay depicting two aspiring musicians whose lives are disrupted by substance abuse, aired on MTV to promote the album. Jackson received nine Grammy Award nominations, becoming the first woman to be nominated for Producer of the Year and winning Best Long Form Music Video for Rhythm Nation 1814. Her Rhythm Nation World Tour 1990 became the most successful debut concert tour by a recording artist, in addition to setting venue records in Japan. She was regarded as a fashion icon, with her "Rhythm Nation" attire being emulated by youth. Proceeds from the tour were used to establish the Rhythm Nation Scholarship and fund other educational programs. Jackson received the MTV Video Vanguard Award and the star on the Hollywood Walk of Fame for her significant contributions to popular culture. <a href="https://www.last.fm/music/Janet+Jackson/Rhythm+Nation+1814">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2011, 03:38', 'summary': 'Although they are now considered a legendary group, leading into the release of their second album, The Infamous, it was far from a given that Albert “Prodigy” Johnson and Kejuan “Havoc” Muchita would enjoy such long and fruitful careers. Their first album, Juvenile Hell, had been a commercial flop, although it did yield a minor hit, “Hit It From The Back,” and led to them being dropped by their first label, 4th & Broadway. Prodigy even admits in his new autobiography, My Infamous Life, that him and Havoc didn’t really take the songwriting and producing process serious for their debut. <a href="https://www.last.fm/music/Mobb+Deep/The+Infamous">Read more on Last.fm</a>.', 'content': 'Although they are now considered a legendary group, leading into the release of their second album, The Infamous, it was far from a given that Albert “Prodigy” Johnson and Kejuan “Havoc” Muchita would enjoy such long and fruitful careers. Their first album, Juvenile Hell, had been a commercial flop, although it did yield a minor hit, “Hit It From The Back,” and led to them being dropped by their first label, 4th & Broadway. Prodigy even admits in his new autobiography, My Infamous Life, that him and Havoc didn’t really take the songwriting and producing process serious for their debut. It’s understandable given that both were teenagers at the time.

Besides, if it was the impetus for what was to come, then it was definitely a good thing. While only producing three songs on Juvenile Hell, the group produced a majority of The infamous, carving out a unique and unmistakable sound. Dark, moody, brooding, and sinister, the music was apocalyptic and Havoc and Prodigy’s unyielding and unremorseful lyrics painted a very bleak picture of what life was like growing up in Queensbridge (yeah, we know Prodigy is from Hempstead, Long Island, but it’s obvious he spent a lot of time in QB). It may have been unnerving to think that a duo so young could entertain such cold-blooded thoughts, but given the overwhelmingly positive response, the realness seemed to resonate.

The album contained huge smashes with “Shook Ones, Pt. II,” and “Survival Of The Fittest,” and disseminated their unique dunn slanguage all over the world <a href="https://www.last.fm/music/Mobb+Deep/The+Infamous">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

