{'published': '03 Mar 2016, 15:50', 'summary': 'Currents is the third studio album by Australian psychedelic rock act Tame Impala, released on 17 July 2015 on Interscope Records. Like the group's previous two albums, Currents was written, recorded, performed, and produced by primary member Kevin Parker. For the first time, Parker also mixed the music. It was also the first time that Parker recorded all instruments by himself; the album featured no other collaborations. After releasing the group's previous record, Lonerism (2012), Parker began work on Currents, largely recording at his home studio in Fremantle. He engrossed himself with writing and recording, and owing to his reputation <a href="https://www.last.fm/music/Tame+Impala/Currents">Read more on Last.fm</a>.', 'content': 'Currents is the third studio album by Australian psychedelic rock act Tame Impala, released on 17 July 2015 on Interscope Records. Like the group's previous two albums, Currents was written, recorded, performed, and produced by primary member Kevin Parker. For the first time, Parker also mixed the music. It was also the first time that Parker recorded all instruments by himself; the album featured no other collaborations.

After releasing the group's previous record, Lonerism (2012), Parker began work on Currents, largely recording at his home studio in Fremantle. He engrossed himself with writing and recording, and owing to his reputation as a musical auteur, labored over the details of each song, ultimately causing the release date to be delayed by two months. In contrast to the psychedelic rock sound of the project's prior work, Currents marks a shift to more dance-oriented music, with more emphasis placed on synthesizers than guitars. Parker was inspired to seek a change out of desire to hear Tame Impala's music played in dance clubs and a more communal setting. Thematically, the record is about the process of personal transformation, which many critics interpreted to be the result of a romantic break-up. The album's cover art depicting vortex shedding is a visualization of these themes.

Currents was preceded by the singles Let It Happen, Cause I'm a Man, Disciples and Eventually. Like its predecessors, the album received critical acclaim. It became the group's best charting release, debuting at number one in Australia, number three in the United Kingdom, and number four in the United States. At the 2015 ARIA Music Awards, Currents was awarded "Best Rock Album" and "Album of the Year", among other honors that Tame Impala received. <a href="https://www.last.fm/music/Tame+Impala/Currents">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '06 Jun 2015, 11:36', 'summary': 'In Rainbows is the seventh studio album by the English alternative rock band Radiohead. It was first released on 10 October 2007 as a digital download that customers could order for whatever price they saw fit, followed by a standard CD release in most countries during the last week of 2007. The album was released in North America on 1 January 2008. In Rainbows was Radiohead's first release after the end of their contract with EMI and the end of the longest gap between studio albums in their career. In Rainbows was recorded in London, Somerset, Wiltshire and Oxfordshire with <a href="https://www.last.fm/music/Radiohead/In+Rainbows">Read more on Last.fm</a>.', 'content': 'In Rainbows is the seventh studio album by the English alternative rock band Radiohead. It was first released on 10 October 2007 as a digital download that customers could order for whatever price they saw fit, followed by a standard CD release in most countries during the last week of 2007. The album was released in North America on 1 January 2008. In Rainbows was Radiohead's first release after the end of their contract with EMI and the end of the longest gap between studio albums in their career.

In Rainbows was recorded in London, Somerset, Wiltshire and Oxfordshire with producers Mark Stent and Nigel Godrich. Radiohead worked on the songs for more than two years, beginning in early 2005. In between recording, the band toured Europe and North America for three months in 2006. Radiohead used a wide variety of musical styles on the album, incorporating string arrangements and electronic music, pianos, celestes and the ondes Martenot, yet renewing their focus on guitars, drums and bass as lead instruments. The songwriting on In Rainbows was more personal than that of Radiohead's other work, with singer Thom Yorke describing it as his attempt to write "seduction songs".

 Upon its retail release, In Rainbows entered the United World Chart, UK Album Chart, and the U.S. Billboard 200 at number one. In Rainbows also earned widespread critical acclaim, and several publications ranked it as one of the best albums of 2007. <a href="https://www.last.fm/music/Radiohead/In+Rainbows">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '04 Apr 2021, 20:55', 'summary': 'The Raincoats is the debut studio album by English rock band the Raincoats. It was released on 21 November 1979 on Rough Trade Records. The album is perhaps best known for its off-kilter cover of "Lola" by the Kinks. The album's sixth track, "The Void", was covered by Hole in 1994. In September 2020, Rolling Stone named The Raincoats the 398th greatest album of all time. The Raincoats was re-released by Rough Trade in 1993 on CD, with liner notes by Nirvana frontman Kurt Cobain. <a href="https://www.last.fm/music/The+Raincoats/The+Raincoats">Read more on Last.fm</a>.', 'content': 'The Raincoats is the debut studio album by English rock band the Raincoats. It was released on 21 November 1979 on Rough Trade Records. The album is perhaps best known for its off-kilter cover of "Lola" by the Kinks. The album's sixth track, "The Void", was covered by Hole in 1994.

In September 2020, Rolling Stone named The Raincoats the 398th greatest album of all time.

