{'published': '08 Aug 2019, 22:38', 'summary': 'Smile (also referred to as Brian Wilson Presents Smile) is the fifth studio album by Brian Wilson, released on September 28, 2004. The project was originally conceived in 1966 as Smile, a concept album recorded by The Beach Boys written in collaboration between Wilson and lyricist Van Dyke Parks. It was intended to succeed the group's 11th studio album Pet Sounds and was based on the engineering methods of their single "Good Vibrations". Many years after the project was shelved due to personal and technical difficulties with recording, Wilson chose to revisit the material with Parks as a specially arranged <a href="https://www.last.fm/music/Brian+Wilson/SMiLE">Read more on Last.fm</a>.', 'content': 'Smile (also referred to as Brian Wilson Presents Smile) is the fifth studio album by Brian Wilson, released on September 28, 2004.

The project was originally conceived in 1966 as Smile, a concept album recorded by The Beach Boys written in collaboration between Wilson and lyricist Van Dyke Parks. It was intended to succeed the group's 11th studio album Pet Sounds and was based on the engineering methods of their single "Good Vibrations". Many years after the project was shelved due to personal and technical difficulties with recording, Wilson chose to revisit the material with Parks as a specially arranged live concert performance. Motivated by the unexpected positive reception, a studio-recorded version was then released by Wilson as a solo album.

Recorded from scratch, Brian Wilson Presents Smile eschews the Beach Boys' Smile sessions by containing all-new instrumental and vocal performances. Recordings from the original Beach Boys' sessions were later released as The Smile Sessions in 2011. <a href="https://www.last.fm/music/Brian+Wilson/SMiLE">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '12 Dec 2013, 15:49', 'summary': 'Supreme Clientele is the second studio album of American rapper and Wu-Tang Clan member Ghostface Killah, released February 8, 2000 on Epic Records. The album showcases Ghostface's signature up-tempo, stream-of-consciousness rhyme style, and features guest appearances from Cappadonna, GZA, Masta Killa, Method Man, Raekwon, Redman, RZA, U-God, and others. If features members of what would become affiliates Theodore Unit and T.M.F. Supreme Clientele contains a large amount of production from group member RZA, who also re-worked and remixed beats from other producers involved, as a means to create a unified and cohesive sound for the album. Supreme Clientele debuted at <a href="https://www.last.fm/music/Ghostface+Killah/Supreme+Clientele">Read more on Last.fm</a>.', 'content': 'Supreme Clientele is the second studio album of American rapper and Wu-Tang Clan member Ghostface Killah, released February 8, 2000 on Epic Records. The album showcases Ghostface's signature up-tempo, stream-of-consciousness rhyme style, and features guest appearances from Cappadonna, GZA, Masta Killa, Method Man, Raekwon, Redman, RZA, U-God, and others. If features members of what would become affiliates Theodore Unit and T.M.F. Supreme Clientele contains a large amount of production from group member RZA, who also re-worked and remixed beats from other producers involved, as a means to create a unified and cohesive sound for the album.

Supreme Clientele debuted at number seven on the Billboard 200 chart and number two on the Top R&B/Hip-Hop Albums chart, while selling 134,000 copies in its first week.  On March 8, 2000, it was certified Gold in sales by the Recording Industry Association of America (RIAA).  The album featured the singles "Apollo Kids" and "Cherchez La Ghost", which, despite receiving limited airplay, went on to achieve notable chart success. Supreme Clientele gained strong reviews from critics, despite its contrasting sound and style to that of his previous critically successful album Ironman.

Supreme Clientele became the most acclaimed out of all second generation Wu-Tang projects, and featured the most contributions from RZA during this era. It was praised and noted for Ghostface Killah's obscure and creative lyrics, and for the cohesive format of production.  Along with Ironman (1996) and FishScale (2006), it is often ranked as Ghostface Killah's best work. It has also been regarded as one of the best solo Wu-Tang albums, and has received accolades for being one of the best albums of the 2000s decade.  A sequel entitled Supreme Clientele Presents... Blue & Cream: The Wally Era is to follow. <a href="https://www.last.fm/music/Ghostface+Killah/Supreme+Clientele">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '06 Jun 2012, 06:35', 'summary': 'Ace of Spades is the fourth album by the British heavy metal band Motörhead. Released on 8 November 1980, it peaked at No. 4 on the UK album charts and reached Gold status by March 1981. It was preceded by the release of the title track as a single on 27 October, which peaked in the UK singles chart at No. 15 in early November. The album was recorded in August and September 1980, produced by Vic Maile at his Jackson's Studio in Rickmansworth. This is the first of what would be a series of projects with Maile, and members <a href="https://www.last.fm/music/Mot%C3%B6rhead/Ace+of+Spades">Read more on Last.fm</a>.', 'content': 'Ace of Spades is the fourth album by the British heavy metal band Motörhead. Released on 8 November 1980, it peaked at No. 4 on the UK album charts and reached Gold status by March 1981. It was preceded by the release of the title track as a single on 27 October, which peaked in the UK singles chart at No. 15 in early November.

The album was recorded in August and September 1980, produced by Vic Maile at his Jackson's Studio in Rickmansworth. This is the first of what would be a series of projects with Maile, and members of the band commented at the time about finding the right producer. Whereas the band had previously had an input at the mixing stage, Maile took sole responsibility here, Clarke explaining that the result was that "you can finally hear everything that's going on".

Of the performances, Lemmy claimed that "Vic got me singing instead of just shouting all the time", while Taylor added "and he got me playing more solid". <a href="https://www.last.fm/music/Mot%C3%B6rhead/Ace+of+Spades">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

