In 2003 the TV network VH1 named it the 70th greatest album in any genre. Call Me was a Top 10 Billboard Pop Album, and the third #1 Soul Album. In 2003, the album was ranked number 289 on Rolling Stone magazine's list of the 500 greatest albums of all time, and 290 in a 2012 revised list.

Praised for his emotive singing style, Green here incorporates country influences, covering both Willie Nelson and Hank Williams. This album contained three top 10 singles on the Billboard Hot 100: "You Ought to Be with Me," "Here I Am (Come and Take Me)" and "Call Me (Come Back Home)." <a href="https://www.last.fm/music/Al+Green/Call+Me">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '10 Oct 2021, 18:24', 'summary': 'Blackout is the fifth studio album by American pop singer Britney Spears, released by Jive Records on October 27, 2007. Spears began working on this album as early as February 2006, exploring into electropop, synthpop and techno. The album has also a more R&B/urban sound and recording with new producers such as Danja. Blackout was her first studio album in four years since 2003's In the Zone and is the first time Spears is the executive producer of one of her albums. The album's title refers to "blacking out negativity and embracing life fully". The songs on the album are <a href="https://www.last.fm/music/Britney+Spears/Blackout">Read more on Last.fm</a>.', 'content': 'Blackout is the fifth studio album by American pop singer Britney Spears, released by Jive Records on October 27, 2007. Spears began working on this album as early as February 2006, exploring into electropop, synthpop  and techno. The album has also a more R&B/urban sound and recording with new producers such as Danja. Blackout was her first studio album in four years since 2003's In the Zone  and is the first time Spears is the executive producer of one of her albums. The album's title refers to "blacking out negativity and embracing life fully".  The songs on the album are thematically focused on sex, love and Spears' relationship–struggle with the media.

Blackout debuted at number two on the Billboard 200, becoming her first and so far only studio album not to debut at number one due to a last-minute rules change by the Billboard music association. According to the IFPI, the album was 32nd in terms of units shipped by the end of 2007.

The album's first single, "Gimme More", peaked at number one in the Canadian Hot 100 and became a top five hit in twelve countries. The second single, "Piece of Me", reached number one in Ireland. The final single, "Break the Ice", reached number one in the Billboard Hot Dance Club Play, making all the singles of the album go to the top position of at least a chart. All three songs frequently appeared on the lists that included the best records of the year. Even though initial critical response was mixed to positive, the album later won high critical acclaim and appeared on many lists that included the decade's best albums. The album was named the 5th "Best Pop Album of the Decade" by The Times, the 7th-best album of the decade on the Rolling Stones "The Decade-End Readers’ Poll", and the 3rd Best Album of the decade on the Billboard "Readers Poll", and won "Album of the Year" at the MTV Europe Music Awards 2008. To date, the album has sold over 3.2 million copies worldwide. <a href="https://www.last.fm/music/Britney+Spears/Blackout">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2009, 03:26', 'summary': 'Some Girls is an album by The Rolling Stones, released in 1978. Considered a highlight of their output and the best of their post-Exile on Main St. records, the album revitalized the band's career upon its release and re-established The Rolling Stones as a vital rock and roll band in an era infused with punk rock and disco. It also became the band's biggest-selling album in the United States, with more than six million copies to date. With the advent of punk rock, The Rolling Stones, among many of their musical contemporaries, were being targeted by some in the movement <a href="https://www.last.fm/music/The+Rolling+Stones/Some+Girls">Read more on Last.fm</a>.', 'content': 'Some Girls is an album by The Rolling Stones, released in 1978. Considered a highlight of their output and the best of their post-Exile on Main St. records, the album revitalized the band's career upon its release and re-established The Rolling Stones as a vital rock and roll band in an era infused with punk rock and disco. It also became the band's biggest-selling album in the United States, with more than six million copies to date.
With the advent of punk rock, The Rolling Stones, among many of their musical contemporaries, were being targeted by some in the movement as cultural dinosaurs, compromising their standing. Mick Jagger felt invigorated by the provocations and was determined to answer them lyrically. It helped, however, that almost all the punks had, openly or not, idolized the Stones in the 1960s and were heavily influenced by the band's rebellious records from that era.

At least as important for the band's reinvigoration was the addition of Ronnie Wood to the lineup, as Some Girls was the first album recorded with him as a full member. His guitar playing style meshed with that of Keith Richards. Wood's pedal steel playing would become one of the band's hallmarks, and his unconventional uses of the instrument are prominent on Some Girls. In addition, Jagger, who had learned to play guitar over the previous decade, contributed a third guitar part to many songs. This gave songs like "Respectable" a three-guitar lineup. <a href="https://www.last.fm/music/The+Rolling+Stones/Some+Girls">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '12 Dec 2020, 13:55', 'summary': 'Fine Line is the second studio album by English singer and songwriter Harry Styles, released on 13 December 2019 by Columbia and Erskine Records. The album's themes involve the initial excitement of meeting someone, breakups, and "having sex and feeling sad", as Styles has said himself. The record has been described as pop rock, with elements of prog-pop, psychedelic pop, folk, soul, funk and indie pop. Supported by five singles—"Lights Up", "Adore You", "Falling", "Watermelon Sugar" and "Golden"—Fine Line debuted at number three on the UK Albums Chart and number one on the Billboard 200, making it Styles' second consecutive <a href="https://www.last.fm/music/Harry+Styles/Fine+Line">Read more on Last.fm</a>.', 'content': 'Fine Line is the second studio album by English singer and songwriter Harry Styles, released on 13 December 2019 by Columbia and Erskine Records. The album's themes involve the initial excitement of meeting someone, breakups, and "having sex and feeling sad", as Styles has said himself. The record has been described as pop rock, with elements of prog-pop, psychedelic pop, folk, soul, funk and indie pop.

Supported by five singles—"Lights Up", "Adore You", "Falling", "Watermelon Sugar" and "Golden"—Fine Line debuted at number three on the UK Albums Chart and number one on the Billboard 200, making it Styles' second consecutive number-one album in the US. The album had the third-largest sales week of 2019 in the US and broke the record as the biggest debut from a British male artist since Nielsen SoundScan began, earning 478,000 album-equivalent units. It has been certified platinum in the US for combined sales and album-equivalent units of over one million units in the country.

Fine Line received generally positive reviews from music critics, particularly towards its production and stylistic influences. It was nominated for Album of the Year at the 2020 Brit Awards, and is nominated for Best Pop Vocal Album at the 2021 Grammy Awards. The album has also received Grammy Award nominations for "Watermelon Sugar" in the Best Pop Solo Performance category and "Adore You" in the Best Music Video category. In 2020, Rolling Stone ranked it number 491 on its list of the 500 Greatest Albums of All Time, making it the most recent album to be included. <a href="https://www.last.fm/music/Harry+Styles/Fine+Line">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

